import React from 'react';

const Username = (props)=>{

	return(
		<div>

            <input type="text" 
         	placeholder="Username" 
            value={props.value} 
            onChange={props.onChange} 
            disabled = {this.props.disabled}
            className="form-control"/>
        </div>

	);

}


export default Username;
